import React from "react";

function QnACompletedQuiz() {
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "#041325",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
      }}
    >
      <div
        style={{
          height: "82vh",
          width: "90vw",
          backgroundColor: "#FFFFFF",
          marginLeft: "5vw",
          marginRight: "5vw",
          marginTop: "9vh",
          marginBottom: "9vh",
          borderRadius: "15px",
          boxShadow: "0px 0px 30px 0px #00000026",
        }}
      >
        <p
          style={{
            marginTop: "7vh",
            textAlign: "center",
            color: "#474444",
            fontSize: "2.5em",
            fontWeight:"600"
          }}
        >
          Congrats Quiz is completed
        </p>
        <p></p>
      </div>
    </div>
  );
}

export default QnACompletedQuiz;
